DIKIDI Business is a free international online booking, automation and promotion platform for masters and companies. Customers of more than 60,000 companies in 87 countries are actively making appointments on the platform. 70+ million appointments are created per year.

Customers book on their own, and you don’t have to waste your time on routine tasks. Thanks to the app, you can manage appointments, customer base, employees, warehouse, income, expenses and much more!
DIKIDI is a complete business automation solution.

DIKIDI Business has the following features:
1. Online booking for your customers using:
- direct links;
- DIKIDI website;
- DIKIDI Online mobile app;
- your website;
- VK (and other social media);
- Telegram, WhatsApp.

2. Reports on key business indicators:
- sales report;
- financial report;
- customer retention;
- Dashboard.

3. Working with customers:
- customer appointments; 
- keeping an electronic journal; 
- maintaining customer cards, viewing their visit history;
- PUSH notifications (customer reviews, new appointments, etc.);
- automatic SMS, WhatsApp messages;
- chats with customers;
- loyalty system (gift cards, loyalty cards, discounts, bonuses and promotions);
- online tips;
- CRM system and full history of each customer.

4. Staff management:
- unlimited number of employee accesses;
- customer retention statistics of each employee;
- salary and additional motivation setup;
- chats with employees.

5. Integrations with other systems:
- online cash registers;
- IP-telephony;

- Google Analytics;
- and many others.

FEATURES:
Chat with technical support, which is in touch 24/7. Specialists will answer all questions and help you implement the platform in your business in real time.

This platform with a large list of features is provided for free!

DIKIDI Business is a reliable and convenient system for automating work in the service sector. All data is protected and available only to users who have access to a workspace, taking into account the assigned rights and roles.

Attend or host online events of all shapes and sizes (online business meetings, virtual classrooms, mid-scale webinars, and huge virtual events) with the latest ClickMeeting app. Take valuable webinar content and important business meetings with you wherever you go.

With fresh, intuitive UX design and stunning audio-video quality, the ClickMeeting online events app is a top choice for sharing knowledge and collaboration on the go.

From now on, the app can work in the background, so your event is not going to turn off if:


•	You use other apps in the meantime, for instance, to send a message to a friend;
•	You don’t take any actions on your screen for a longer time.



Attendees:

What can you expect from using the app?

•	No screen-swiping to view a presentation, a presenter, and a chat. You can see it all on one screen.
•	An incredibly easy way to join online events.
•	The audio-video streaming quality will knock your socks off! J



Organizers:

With the ClickMeeting webinar app, you can:

•	Use a customized Call-To-Action button to redirect your events’ attendees to a landing page of your choice;

•	Stream your events live on Facebook or YouTube;
•	Interact with your audience in real-time through the Q&A mode;
•	Make the most of your files stored in your cloud (Dropbox, OneDrive, Google Drive).


ClickMeeting – inspire, teach, sell, and collaborate 


ClickMeeting is a browser-based web conferencing platform loved by thousands of business customers all over the globe. Flexibility and scalability make their online events platform a top choice for solopreneurs, startups, small and medium companies, and large enterprises that discovered video conferencing as a perfect way to achieve their goals.

Who makes the most of ClickMeeting digital get-togethers?

•	Marketers;
•	Sales teams;
•	Remote teams;
•	Online teachers and trainers;
•	C-level executives;
•	Business and professional associations;
•	HR specialists.


What types of online events can you host on the ClickMeeting web conferencing platform?

1.	Live webinars. A classic and most popular version of webinars. You schedule your online event to happen at a specific time and, then, you meet your audience live. Live webinars are an ideal match for onboarding and training purposes as well as with sales events and product demos.
2.	On-demand webinars. With this option, you pre-record your webinar to release it to your contacts, leads, or students so they can watch it anytime and anywhere they want. If your goal is generating leads and running online courses, on-demand webinars will be a way to go!
3.	Automated webinars. Unlike on-demand events, you schedule automated webinars to take place on a specific day and hour. However, just like above, you need to have a recorded material first and then enrich them with tools like Call-To-Action, a video clip, or a survey.
4.	Online meetings. Planned in advance or organized spontaneously. Online meetings are smaller web gatherings where up to 25 participants can see, hear, and talk to each other in one virtual conference room. It’s a way to go if you’re on the lookout for a real-time collaboration tool and organize virtual meetups with your team, customers, or business partners.
5.	Huge virtual events. Powered up with webcasting technology, huge virtual events give you a chance to stream your content for up to 10k viewers!
